e incontinence and lose communication skills such as speech and become increasingly dependent on others.\\r\\n\\r\\nThe Dementia Service is a joint collaboration between the successful bidder and the lead NHS Mental Health Trust organisation. The service being tendered is for the Dementia Navigation Service, which is part of the overall Dementia Service and comprises of Dementia Navigators supported by a Team of professionals from the NHS lead Organization which includes Consultants (Psychiatrist and Psycho-Geriatrician), Nurses, Psychologists, Occupational Therapists, and Administrators. The Dementia Navigation, information and Support Service will work as an integral part of the Dementia Service (DS) to support City and Hackney residents aged 18 years and over with dementia, their carers, families and friends. The purpose of the dementia navigation, information and support service is to enable people diagnosed with dementia and their carers to come to terms with their diagnosis, reduce social isolation and live well with dementia.\\r\\n\\r\\n\\r\\nAdditional information: \\r\\nThe Contract is expected to commence on 1st April 2022, with the possible deadline for delivery of the service being 31st March 2028.\\r\\n\\r\\nBidders are requested to review the contents of the ITT guidance document carefully, register their organisation, and express their interest in the ITT via the e-tendering portal (ProContract). ITT documentation can be accessed following initial registration and expression of interest via the e-tendering portal:\\r\\n\\r\\nhttps://proContract.due-north.com/register\\r\\n\\r\\nAny reference to \\\"the e-tendering portal\\\" should be considered reflective of the above web address.\\r\\n\\r\\nThe ITT has been issued through the e-tendering portal. All Bidders wishing to participate must complete and submit Bids that comply with the requirements set out in the ITT document. Bidders are required to complete the online questionnaire on procontract and upload any attachments as indicated before the deadline for submission of bids specified in the ITT document.\\r\\n\\r\\nThe project on Procontract Portal can be accessed by clicking the following link: -https://procontract.due-north.com/Advert?advertId=5288d442-7951-ed11-811a-005056b64545\\r\\n\\r\\nThe deadline for the submission of tender is 12 Noon on 21 November 2022.\\r\\n\\r\\nThe deadline for any clarification questions is 1700hrs on 11th November 2022. All clarification questions must be submitted via the messaging facility on Pro-contract.\",\n                \"datePublished\": \"2022-10-21T22:24:45+01:00\",\n                \"status\": \"active\",\n                \"classification\": {\n                    \"scheme\": \"CPV\",\n                    \"id\": \"85000000\",\n                    \"description\": \"Health and social work services\"\n                },\n                \"additionalClassifications\": [\n                    {\n                        \"scheme\": \"CPV\",\n                        \"id\": \"75100000\",\n                        \"description\": \"Administration services\"\n                    }\n                ],\n                \"items\": [\n                    {\n                        \"id\": \"1\",\n                        \"deliveryAddresses\": [\n                            {\n                                \"postalCode\": \"E15 1DA\"\n                            },\n                            {\n                                \"countryName\": \"British Oversea Territories\"\n                            },\n                            {\n                                \"countryName\": \"Channel Islands\"\n                            },\n                            {\n                                \"countryName\": \"Europe\"\n                            },\n                            {\n                                \"countryName\": \"Isle of Man\"\n                            },\n                            {\n        