tlist.\\r\\n\\r\\nThe service being tendered is to provide an adult ADHD digital solution to assist with expediating waitlists. Commissioners are looking for a Provider who can provide ADHD assessment, diagnosis and treatment and commit to patients being transferred back to their GP, under shared care arrangements.\\r\\n\\r\\nThe successful provider will only be receiving referrals from the Secondary Mental Health Provider, Norfolk and Suffolk Foundation Trust (NSFT).\\r\\n\\r\\nIf you are interested in expressing an interest in this opportunity, you should register and log into EU Supply at the following url: https://uk.eu-supply.com/login.asp?B=agcsu, and then search for Quote/tender 60294 - NW088b - Adult ADHD Digital Assessment and Treatment Service (Waitlist) for Norfolk & Waveney and complete the ITT Qualification and Technical questions and the Commercial / Price question by 12pm 25th November 2022.\",\n                \"datePublished\": \"2022-10-21T19:34:32+01:00\",\n                \"status\": \"active\",\n                \"classification\": {\n                    \"scheme\": \"CPV\",\n                    \"id\": \"85000000\",\n                    \"description\": \"Health and social work services\"\n                },\n                \"items\": [\n                    {\n                        \"id\": \"1\",\n                        \"deliveryAddresses\": [\n                            {\n                                \"region\": \"East of England\",\n                                \"countryName\": \"United Kingdom\"\n                            }\n                        ]\n                    }\n                ],\n                \"procurementMethod\": \"open\",\n                \"procurementMethodDetails\": \"Open procedure\",\n                \"tenderPeriod\": {\n                    \"endDate\": \"2022-11-25T23:59:59Z\"\n                },\n                \"contractPeriod\": {\n                    \"startDate\": \"2023-04-01T00:00:00+01:00\",\n 