": \"20221021183447-30508\",\n                \"title\": \"Provision of IT & Digital Managed Services\",\n                \"description\": \"Avon Fire Authority (\'Authority\') is seeking a managed service provider that will work with them to provide a functional, modern, reliable, available, stable, consistent, and cost-effective IT service. We also require a provider that will\\twork with us to develop new solutions to assist with our digital transformation programme and ensure we are an organisation that is fit for the future and continually evolving.\\r\\n\\r\\nWe are seeking a Managed Service Provider who will relish the opportunity to work with us to achieve our digital ambitions to improve our service both internally and to the wider community. We require a contractor who will work in partnership with us to provide the following:\\r\\n\\r\\nâ¢\\tA helpdesk and technical support for all staff, in all AF&RS locations, including equipment on operational vehicles. There is also a requirement to assist and support staff with remote and home working. \\r\\n\\r\\nâ¢\\tOut of core hours support for emergency fault resolution, major incident resolution and management. Noting that as an emergency service 24/7, availability is crucial.\\r\\n\\r\\n\\r\\nâ¢\\tSpecialist strategic and technical advice on all IT related matters, including information security. \\r\\n \\r\\nâ¢\\tProvision of development services including identifying opportunities for and deliver improvements to IT and business processes, workflows, automate repetitive tasks and minimise the risks of errors. \\r\\n \\r\\nâ¢\\tProvide technical input and expertise into the development of AF&RS\'s IT Strategy (noting that the IT Strategy is owned by the client side team).\\r\\n\\r\\nâ¢\\tSupporting significant projects and organisational changes taking place that may involve the IT provision within AF&RS. \\r\\n \\r\\nâ¢\\tAn onsite presence (during core hours as defined later in this document but not o