           ]\n                }\n            ],\n            \"buyer\": {\n                \"id\": \"GB-CFS-35016\",\n                \"name\": \"South Tees Hospitals NHS Foundation Trust\"\n            }\n        },\n        {\n            \"ocid\": \"ocds-b5fd17-372bdcd7-65c8-4837-995a-c65eb663be97\",\n            \"id\": \"c6d70d85-651d-4508-a8a0-d974bf2e4c39-583163\",\n            \"language\": \"en\",\n            \"date\": \"2022-10-21T17:45:45+01:00\",\n            \"tag\": [\n                \"tender\"\n            ],\n            \"initiationType\": \"tender\",\n            \"tender\": {\n                \"id\": \"MT227730\",\n                \"title\": \"Sheffield Covid Memorial brief\",\n                \"description\": \"Sheffield Museums is working with Sheffield City Council to appoint an artist to design and construct a Covid Memorial within Sheffield\'s city centre. The engagement, involvement and ownership of the memorial by the people of Sheffield is a fundamental part of this project and we are particularly looking for an artist with experience of working with under-represented communities to create work in the public realm.The memorial will be sited within Balm Green Gardens in Sheffield City Centre. It will become a focal point to mark Sheffield\'s experience of Covid and a place where people come to remember loved ones and reflect on the help and support of services, community, neighbours, friends, and family.  The memorial will be a lasting testimony to the city\'s experience - celebrating small acts of kindness, supporting positive change and remembering those we have lost.Sheffield City Council anticipate that the memorial will be in place for the third national commemoration of the pandemic on the 23rd March 2023. The successful artist will be able to develop and install the work within this timescale and will be required to engage with a wide range of stakeholders until September 2023. The selection process will be facilitated by Sheffield Museums on behalf of Sheffield City Council. Once appointed, the artist will be contracted to Sheffield City Council.\",\n                \"datePublished\": \"2022-10-21T17:45:44+01:00\",\n                \"status\": \"active\",\n                \"classification\": {\n                    \"scheme\": \"CPV\",\n                    \"id\": \"92000000\",\n                    \"description\": \"Recreational, cultural and sporting services\"\n                },\n                \"items\": [\n                    {\n                        \"id\": \"1\",\n                        \"deliveryAddresses\": [\n                            {\n                                \"region\": \"Yorkshire and the Humber\",\n                                \"countryName\": \"United Kingdom\"\n                            }\n                        ]\n                    }\n                ],\n                \"value\": {\n                    \"amount\": 140000,\n                    \"currency\": \"GBP\"\n                },\n                \"procurementMethod\": \"open\",\n                \"procurementMethodDetails\": \"Open procedure\",\n                \"tenderPeriod\": {\n                    \"endDate\": \"2022-11-21T23:59:59Z\"\n                },\n                \"contractPeriod\": {\n                    \"startDate\": \"2022-12-02T00:00:00Z\",\n                    \"endDate\": \"2023-09-29T23:59:59+01:00\"\n                },\n                \"suitability\": {\n                    \"sme\": true,\n                    \"vcse\": true\n                },\n                \"mainProcurementCategory\": \"services\",\n                \"documents\": [\n                    {\n                        \"id\": \"1\",\n                        \"documentType\": \"tenderNotice\",\n                        \"description\": \"Opportunity notice on Contracts Finder\",\n                        \"url\": \"https://www.contractsfinder.service.gov.uk/Notice/c6d70d85-651d-4508-a8a0-d974bf2e4c39\",\n         