d for a new facility in the East of the City that complements other ongoing changes to the existing City of London Police Estate, including creation of a major new Police Headquarters facility in Salisbury Square. The development will comprise of several new compounds on the Basement and Ground floor carpark level, supported by incorporating six shop units along Gravel Lane and the redundant first-floor car park to provide \'touch down\' office space and support/storage facilities, as well as sufficient space to park operational vehicles. As part of the Eastern Base development the existing City of London Police compound will be moved to a different area of the basement car park and the area used to provide a new enhanced residents\' parking facility with improved lighting and security (additional CCTV coverage and access-controlled entry) along with accessible and electric vehicle charging bays and increased cycle parking areas.\\r\\n\\r\\nThe City are currently considering options regarding procurement strategy for the project (e.g. two-stage procurement, traditional, design and build) and would like to engage, via soft market testing, with interested and suitably qualified suppliers to understand the potential benefits and risks of the various options. Suppliers who wish to engage in this market testing exercise should contact the City via the named contact in this notice.\\r\\nDue to security reasons, access to further project specific information is restricted.\\r\\nSuppliers will be required to sign a non- disclosure agreement (NDA) prior to further\\r\\ndiscussions on the project. Please use the contact details provided within this notice in order to access the NDA. Suppliers may be asked to complete a short questionnaire as part of this market testing.\\r\\n\\r\\nAdditional information: \\r\\nFor further details please see the published Prior Information Notice\",\n                \"status\": \"planning\",\n                \"classification\": {\n            