: \"CR0 1EA\",\n                        \"countryName\": \"United Kingdom\"\n                    },\n                    \"contactPoint\": {\n                        \"name\": \"Toni Dowding\",\n                        \"email\": \"Toni.Dowding@croydon.gov.uk\",\n                        \"telephone\": \"+44 2087266000\"\n                    },\n                    \"details\": {\n                        \"url\": \"http://www.croydon.gov.uk\"\n                    },\n                    \"roles\": [\n                        \"buyer\"\n                    ]\n                }\n            ],\n            \"buyer\": {\n                \"id\": \"GB-CFS-70017\",\n                \"name\": \"Croydon Council\"\n            }\n        },\n        {\n            \"ocid\": \"ocds-b5fd17-2d605ee8-7307-4649-88a8-3e776c51147e\",\n            \"id\": \"c427766d-3fc8-41c4-9bf3-8d18d382aabb-583132\",\n            \"language\": \"en\",\n            \"date\": \"2022-10-21T17:11:27+01:00\",\n            \"tag\": [\n                \"tender\"\n            ],\n            \"initiationType\": \"tender\",\n            \"tender\": {\n                \"id\": \"GLA 27248\",\n                \"title\": \"GLA 27248- Implementing Building a Fairer City plan - a communities of practice approach\",\n                \"description\": \"This project comes under Light Touch Regime. \\r\\n\\r\\nA consultant will be appointed to support the implementation of Building a Fairer London through the delivery of a programme of support for partners, hosting communities of practice discussions, providing complimentary peer support through group learning opportunities, and reporting on progress annually, so that there is measurable progress against the four priority areas.\\r\\n\\r\\nA series of metrics to measure progress each year will be developed by appointed organisation, working in partnership with the GLA\'s City Intelligence Unit. Following discussions with City Intelligence Unit it is suggested that potential outcomes/indicators can be developed across the four priority areas. For example:\\r\\nâ¢\\tMeasurable progress in workforce diversity metrics for participating organisations - Labour market inequality\\r\\nâ¢\\tNumber of participating organisations reaching \'excellence\' level for the \'fair pay and conditions pillar of the Mayor\'s Good Work Standard - Financial hardship and living standards\\r\\nâ¢\\tLevels of trust/confidence in relevant institutions or vaccination rates for specific communities -  Equity in public services\\r\\nâ¢\\tProportion of funding allocated to different equity led groups by public bodies - Civil Society Strength. \\r\\n\\r\\nThe appointed organisation will be expected to complete specific tasks/deliverables including to:\\r\\nâ¢\\tDevelop and deliver a communities of practice programme for each of the priority areas\\r\\nâ¢\\tDevelop and deliver group peer learning opportunities that provide support to organisations to increase understanding of structural inequalities/racism, or in monitoring the outcomes associated with addressing those specific problems and challenges. This will be measured by case studies provided by consultant\\r\\nâ¢\\tDevelop a framework including metrics to measure progress annually\\r\\nâ¢\\tAttend governance meetings with the chair of the LRB Equalities Subgroup as agreed to allow continuous evaluation of the success of the programme\\r\\nâ¢\\tPrepare and deliver update reports, including a annual progress report to the LRB\\r\\n\\r\\nAdditional information: How to register for the project: \\r\\nTfL is using SAP Ariba as a sourcing platform to issue tenders. \\r\\n\\r\\nTo collaborate with TfL through SAP Ariba you must be registered on the platform, and your profile and data must be up-to-date. \\r\\n\\r\\nHow to register on Ariba Business Network and participate in the tender:\\r\\n\\r\\nRegister Interest for the tender by contacting the Commercial contact listed on Find a Tender/ Contract Finder posting \\r\\n\\r\\nIf you have never done business before with TfL and are not a known supplier complete the request form at the following link https://s1-eu.ariba.com/Sourcing/Main/ad/selfRegistration?realm=TfL . This will create the contact within Ariba to enable invite participation.\\r\\n\\r\\nCreate an Ariba Business Network account\",\n                \"datePublished\": \"2022-10-21T17:11:27+01:00\",\n                \"status\": \"active\",\n                \"classification\": {\n                    \"scheme\": \"CPV\",\n                    \"id\": \"85100000\",\n                    \"description\": \"Health services\"\n                },\n                \"additionalClassifications\": [\n                    {\n                        \"scheme\": \"CPV\",\n                        \"id\": \"85300000\",\n                        \"description\": \"Social work and related services\"\n                    },\n                    {\n                        \"scheme\": \"CPV\",\n                        \"id\": \"98200000\",\n                        \"description\": \"Equal opportunities consultancy services\"\n                    }\n                ],\n                \"items\": [\n                    {\n                        \"id\": \"1\",\n                        \"deliveryAddresses\": [\n                            {\n                                \"region\": \"London\",\n                                \"countryName\": \"United Kingdom\"\n                            }\n                        ]\n                    }\n                ],\n                \"value\": {\n                    \"amount\": 90000,\n                    \"currency\": \"GBP\"\n                },\n                \"procurementMethod\": \"open\",\n                \"procurementMethodDetails\": \"Open procedure (below threshold)\",\n                \"tenderPeriod\": {\n                    \"endDate\": \"2022-11-10T23:59:59Z\"\n                },\n                \"contractPeriod\": {\n