-b6a9-f4b3888cbd19\",\n                        \"datePublished\": \"2022-10-21T17:10:03+01:00\",\n                        \"format\": \"text/html\",\n                        \"language\": \"en\"\n                    },\n                    {\n                        \"id\": \"2\",\n                        \"documentType\": \"tenderNotice\",\n                        \"description\": \"Please follow this link to view the notice.\",\n                        \"url\": \"https://www.delta-esourcing.com/tenders/UK-GB-Kings-Lynn:-LED-Video-Panel-Package/6SQC9K9AH6\"\n                    }\n                ]\n            },\n            \"parties\": [\n                {\n                    \"id\": \"GB-CFS-86829\",\n                    \"name\": \"Borough Council of King\'s Lynn & West Norfolk\",\n                    \"identifier\": {\n                        \"legalName\": \"Borough Council of King\'s Lynn & West Norfolk\"\n                    },\n                    \"address\": {\n                        \"streetAddress\": \"Kings Court, Chapel Street\",\n                        \"locality\": \"King\'s Lynn\",\n                        \"postalCode\": \"PE30 1EX\",\n                        \"countryName\": \"UK\"\n                    },\n                    \"contactPoint\": {\n                        \"name\": \"Procurement Team\",\n                        \"email\": \"procurementtenders@west-norfolk.gov.uk\",\n                        \"telephone\": \"+441553616200\"\n                    },\n                    \"roles\": [\n                        \"buyer\"\n                    ]\n                }\n            ],\n            \"buyer\": {\n                \"id\": \"GB-CFS-86829\",\n                \"name\": \"Borough Council of King\'s Lynn & West Norfolk\"\n            }\n        },\n        {\n            \"ocid\": \"ocds-b5fd17-22d6bc95-1a84-485b-9e82-d3cf7967b99c\",\n            \"id\": \"f60c1666-7f05-423b-8612-f2f01ba085eb-583139\",\n            \"language\": \"en\",\n            \"date\": \"2022-10-21T17:06:27+01:00\",\n            \"tag\": [\n                \"tenderAmendment\"\n            ],\n            \"initiationType\": \"tender\",\n            \"tender\": {\n                \"id\": \"tender_316219/1103862\",\n                \"title\": \"UKRI PS22245 - The Provision of a Programme of Events and Activities to Scale Innovation in Net- Zero\",\n                \"description\": \"The final date and time for the submission of bids is Monday 07th November 2022 at 11:00\\r\\n\\r\\nDO NOT apply directly to the buyer.\\r\\n\\r\\nAll tender information MUST be submitted through the Jaggaer eSourcing Portal.\\r\\n\\r\\nBrief Description of Requirement\\r\\nInnovate UK is the UK\'s national innovation agency. We support business-led innovation in all sectors, technologies and UK regions. We will help the UK achieve a net zero carbon economy in 2050 and better protect the environment. We aim to help the UK become a global leader in transitioning to a net zero economy by building a coherent, supportive environment enabling people and businesses to innovate. \\r\\n \\r\\nWe face a time limited challenge to achieve net zero by 2050 and recognise the opportunity for businesses to grow to significantly impact this and offer global solutions. Innovative scalable net zero businesses and solutions are needed to reach our net zero targets, however there is a market failure that will prevent many of them from reaching maturity. \\r\\n \\r\\nInnovate UK wants to convene, create dialogue and action by bringing together the net zero innovation and sector specific investment and procurement communities to accelerate adoption at scale and sector investment.  We want to deliver a programme of events and activities that;\\r\\n-\\tprovide opportunities for net zero businesses to engage relevant investors\\r\\n-\\tgive investors insight on market opportunities in the net zero sector\\r\\n-\\tunlock barriers for net zero businesses to grow and scale, and\\r\\n-\\tenhance the net zero innovation ecosystem. \\r\\n \\r\\nWe are seeking an external partner to design, develop and deliver this 2 Â½ year programme in partnership with Innovate UK, Innovate UK KTN and Innovate UK EDGE. This programme should be delivered with the ambition to grow to be a staple of UK innovation response to net zero by 2050 over the next 30 years. \\r\\n\\r\\nPlease ensure you review all attached information to ensure a full understanding of this requirement. All attachments can be found with the Supplier Attachments tab within the Jaggaer eSourcing Portal. \\r\\n\\r\\nThis contract will be awarded based on the evaluation criteria as set out in the RFP document. \\r\\n\\r\\nHow to Apply\\r\\n\\r\\nUK Shared Business Services Ltd (UK SBS) will be using the Jaggaer eSourcing Portal for this procurement. \\r\\n\\r\\nTo register on the Jaggaer eSourcing portal please use the link https://beisgroup.ukp.app.jaggaer.com/ and follow the instructions to register as a supplier.\\r\\n\\r\\nIf you are already registered on the Jaggaer eSourcing Portal and wish to participate in this procurement, please use the link: https://beisgroup.ukp.app.jaggaer.com/.\\r\\n\\r\\nOnce you are logged into the system you will be able to locate the Procurement you wish to leave a bid on by clicking the ITTs Open to All Suppliers and searching for reference number PS22245\\r\\n\\r\\nAdditional information: \\r\\nDO NOT APPLY DIRECTLY TO BUYER\\r\\n\\r\\nAll submissions will be assessed in accordance with the Public Procurement Regulations that apply to this opportunity.\\r\\n\\r\\nResponses must be received by the date and time in the tender documentation; responses received outside of the deadline or not sent via the Jaggaer eSourcing portal will not be accepted or considered by the Contracting Authority further for this opportunity, unless a system outage is experienced, to which the Contracting Authority will advise upon accordingly. Interested organisations should ensure that they allow a sufficiency of time, prior to the deadline to allow all sections to be completed in full and any attachments to be uploaded.\\r\\n\\r\\nAs a user of the Jaggaer eSourcing Portal you will have access to the Jaggaer messaging service which facilitates all messages sent to you and from you, as well as other messages and updates in relation to any specific tender event. Please note that any and all information secured outside of the messaging service, shall have no Legal Standing, merit or worth and should not be relied upon by any organisation submitting a tender response. \\r\\n\\r\\nPlease note it is your organisations responsibility to access these messages on a regular basis to ensure you have sight of all relevant information applicable to this opportunity.\\r\\n\\r\\nThe Contracting Authority expressly reserves the right:\\r\\n\\r\\ni.\\tnot to award any contract as a result of the procurement process commenced by publication of this notice; and\\r\\n\\r\\nii.\\tto make whatever changes it may see fit to the content and structure of the procurement; and under no circumstances as part of your organisations participation in this opportunity, will the Contracting Authority be liable for any costs incurred by any organisation as a result. If the Contracting Authority decides to enter into a contract with any successful organisation(s), this does not mean that there is any guarantee of subsequent contracts being awarded. Any expenditure, work or effort undertaken prior to contract award is accordingly a matter solely for the commercial judgement of your organisation in doing so.\\r\\n\\r\\nAbout UK Shared Business Services \\r\\n\\r\\nUK Shared Business Services Ltd (UK SBS) brings a commercial attitude to the public sector; helping our contracting authorities to improve efficiency, generate savings and modernise.\\r\\n\\r\\nWhere UK SBS is not named as the Contracting Authority within the documentation, UK SBS will be acting as an agent on behalf of the Contracting Authority.\\r\\n\\r\\nOur broad range of expert services is shared by our customers. This allows our customers the freedom to focus resources on core activities; innovating and transforming their own organisations.\\r\\n\\r\\nFor full details of our partner base please review the following link: http://www.uksbs.co.uk/services/procure/contracts/Pages/default.aspx\",\n                \"datePublished\": \"2022-09-23T17:12:32+01:00\",\n                \"status\": \"active\",\n                \"classification\": {\n                    \"scheme\": \"CPV\",\n                    \"id\": \"79952000\",\n                    \"description\": \"Event services\"\n                },\n                \"items\": [\n                    {\n                        \"id\": \"1\",\n                        \"deliveryAddresses\": [\n                            {\n                                \"countryName\": \"British Oversea Territories\"\n                            },\n                            {\n                                \"countryName\": \"Channel Islands\"\n                            },\n                            {\n                                \"countryName\": \"Europe\"\n                            },\n                            {\n                                \"countryName\": \"Isle of Man\"\n                            },\n                            {\n                                \"countryName\": \"Rest of the World\"\n                            },\n                            {\n                                \"countryName\": \"United Kingdom\"\n                            }\n                        ]\n                    }\n                ],\n                \"value\": {\n                    \"amount\": 250000,\n                    \"currency\": \"GBP\"\n                },\n                \"procurementMethod\": \"open\",\n                \"procurementMethodDetails\": \"Open procedure (above threshold)\",\n              