s partners in the voluntary and community sector to deliver good outcomes as early as possible.  The services will not support those children, young people and families already known to and in receipt of support from specialist and statutory services, rather they will ensure delivery of support that complements, not duplicates existing services such as;\\r\\n\\r\\nâ¢\\tSchool funded support at additional levels of need\\r\\nâ¢\\tEssex Child and Family Wellbeing Service\\r\\nâ¢\\tEssex Integrated Wellbeing Service \\r\\nâ¢\\tChild and Adolescent Mental Health Service\\r\\nâ¢\\tFamily Solutions\\r\\n\\r\\nBy Early Intervention we mean stopping something occurring or getting worse and for the purposes of this funding will provide brief, light touch interventions that will enable children, young people, parents and carers to draw on their own resources and resilience to resolve future problems. \\r\\n\\r\\nThis Grant is concerned with working with children and young people with exhibiting early signs of risky behaviours working in schools and youth settings through small group programmes.  This will usually take place face to face however, it may also take place using on-line platforms if that is deemed appropriate, for example during holiday periods or weekends/evenings.\\r\\n\\r\\nThe total Family Innovation Fund is Â£1,200,000 over three years, Â£480,000 of which is allocated for the Risky Behaviours programme (RBP).\\r\\n\\r\\n\\t2023/24\\t\\tÂ£200,000\\r\\n\\t2024/25\\t\\tÂ£140,000\\r\\n\\t2025/26\\t\\tÂ£140,000\\r\\n\\r\\nRBP will be delivered across Essex but priority will be given to The Essex Levelling Up  areas set out in the table in 6.1 to support the delivery of our levelling ambitions and Everyone\'s Essex Plan Everyones Essex \\r\\n\\r\\nThere will be provision within the Grant Agreement, at the discretion of ECC to extend the grants for up to two years on a one plus one year basis.  There will be further provision for the value to be varied within any extension up to the original year one value namely Â£200,000.\\r\\n\\r\\nProvision in the Grant Agreement (clause 12) outlines the conditions under which ECC will either withhold or claim back funds paid to the provider.\\r\\n\\r\\n\",\n                \"datePublished\": \"2022-10-21T17:03:48+01:00\",\n                \"status\": \"active\",\n                \"classification\": {\n                    \"scheme\": \"CPV\",\n                    \"id\": \"98900000\",\n                    \"description\": \"Services provided by extra-territorial organisations and bodies\"\n                },\n                \"additionalClassifications\": [\n                    {\n                        \"scheme\": \"CPV\",\n                        \"id\": \"85300000\",\n                        \"description\": \"Social work and related services\"\n                    },\n                    {\n                        \"scheme\": \"CPV\",\n                        \"id\": \"98100000\",\n                        \"description\": \"Membership organisation services\"\n                    }\n                ],\n                \"items\": [\n                    {\n                        \"id\": \"1\",\n                        \"deliveryAddresses\": [\n                            {\n                                \"region\": \"East of England\",\n                                \"countryName\": \"United Kingdom\"\n                            }\n                        ]\n                    }\n                ],\n                \"value\": {\n                    \"amount\": 480000,\n                    \"currency\": \"GBP\"\n                },\n                \"procurementMethod\": \"open\",\n                \"procurementMethodDetails\": \"Open procedure\",\n                \"tenderPeriod\": {\n                    \"endDate\": \"2022-12-16T23:59:59Z\"\n                },\n                \"contractPeriod\": {\n                    \"startDate\": \"2023-04-01T00:00:00+01:00\",\n                    \"endDate\": \"2026-03-31T23:59:59+01:00\"\n                },\n                \"suitability\": {\n                    \"sme\": true,\n                    \"vcse\": false\n                },\n                \"mainProcurementCategory\": \"services\",\n                \"documents\": [\n                    {\n                        \"id\": \"1\",\n                        \"documentType\": \"tenderNotice\",\n                        \"description\": \"Opportunity notice on Contracts Finder\",\n                        \"url\": \"https://www.contractsfinder.service.gov.uk/Notice/b457e576-96e4-4eea-831b-3c89ee0c2db3\",\n                        \"datePublished\": \"2022-10-21T17:03:48+01:00\",\n                        \"format\": \"text/html\",\n                        \"language\": \"en\"\n                    }\n                ]\n            },\n            \"parties\": [\n                {\n                    \"id\": \"GB-CFS-145188\",\n                    \"name\": \"Essex County Council\",\n                    \"identifier\": {\n                        \"legalName\": \"Essex County Council\"\n                    },\n                    \"address\": {\n                        \"streetAddress\": \"County Hall, Market Road\",\n                        \"locality\": \"Chelmsford\",\n                        \"postalCode\": \"CM1 1QH\",\n                        \"countryName\": \"England\"\n                    },\n                    \"contactPoint\": {\n                        \"name\": \"John Sharman\",\n                        \"email\": \"john.sharman@essex.gov.uk\",\n                        \"telephone\": \"+44 333 013 7259\"\n                    },\n                    \"details\": {\n                        \"url\": \"https://www.essex.gov.uk/\"\n                    },\n                    \"roles\": [\n                        \"buyer\"\n                    ]\n                }\n            ],\n            \"buyer\": {\n                \"id\": \"GB-CFS-145188\",\n                \"name\": \"Essex County Council\"\n            }\n        },\n        {\n            \"ocid\": \"ocds-b5fd17-44e94f92-fb69-4938-b2b8-fb995d3e1cef\",\n            \"id\": \"d4d9a189-8dff-4dc5-bd94-5df79e62c2ab-583129\",\n            \"language\": \"en\",\n            \"date\": \"2022-10-21T17:02:35+01:00\",\n            \"tag\": [\n                \"tender\"\n            ],\n            \"initiationType\": \"tender\",\n            \"tender\": {\n                \"id\": \"SCS Workshops\",\n                \"title\": \"Species Conservation Strategies workshop design, facilitation and analysis\",\n                \"description\": \"Natural England needs to further consider the potential scope of Species Conservation Strategies (SCS) and the range of possibilities for using this new legal tool to best effect to help recover nature. \\r\\n\\r\\nWe have a great opportunity to shape and influence how SCS could be used for species conservation planning. These strategies could potentially be used in a more ambitious way and Natural England and key stakeholders agree they must be holistic and dynamic. Identifying all the conservation actions needed, joined up with other key environmental initiatives and policies (such as Local Nature Recovery Strategies - LNRS, the Environmental Land Management System - ELMS, and Biodiversity Net Gain - BNG), and adaptive so that they can be implemented to best effect to help recover species.\\r\\n\\r\\nThe purpose of this contract is to help facilitate thinking within Natural England and Defra about the future use of SCS by bringing together expert staff through a series of internal workshop sessions to be held during autumn/winter 2022/23.\\r\\n\\r\\nThe aim of the workshops is to help us to think broadly and ambitiously about the possibilities for using SCS to recover nature, how SCS could be used in practice, where we should focus our efforts, and what sort of system is needed to prioritise whether a species warrants an SCS.\\r\\n\\r\\nThe outputs from the workshops will be used to help inform:\\r\\n\\r\\nâ¢\\tFurther engagement activity with external stakeholders and partners about SCS.\\r\\nâ¢\\tA discussion paper (for Natural England Senior Leaders and Defra) proposing future direction for SCS and next steps.\\r\\nâ¢\\tDevelopment of a framework to help guide decisions about when an SCS is needed. \\r\\n\\r\\nWe anticipate holding three workshops, with up to 20-25 people at each session. Locations to be confirmed but likely to be Peterborough, London or Bristol (or a combination). The requirement is for a contractor to design and facilitate these workshops and capture the outputs in a narrative report. An environmental background with experience of IUCN Conservation Planning methods and approaches would be advantageous, although not essential.\\r\\n\\r\\nAdditional information: Prices must be submitted in Â£ sterling, inclusive of VAT. \\r\\n\\r\\nA completed submission must include the following items:\\r\\nâ¢\\tevidence that you meet the quality criteria set out in the specification\\r\\nâ¢\\tyour proposed pricing structure (see specification requirement for items to cover)\\r\\nâ¢\\tyour proposed timing plans given the start and end dates outlined\\r\\n\\r\\nEvaluating the quotation submission\\r\\n\\r\\nSubmissions will be reviewed and then evaluated as set out below:\\r\\n\\r\\nâ¢\\teach criteria will be given a score from 0 to 100\\r\\nâ¢\\tthe criteria scores will be weighted to create a final submission score\\r\\nâ¢\\tall of the final submission scores will be ranked\\r\\nâ¢\\tthe agency with the highest weighted score for the chosen field date will be awarded the contract - subject to the terms and conditions within the RFQ\\r\\n\\r\\nWe will award this contract in line with the most economically advantageous tender (MEAT) as set out in the following award criteria:\\r\\n\\r\\nPrice - 50%\\r\\n\\r\\nQuality - 50%\",\n                \"datePublished\": \"2