                \"documents\": [\n                    {\n                        \"id\": \"1\",\n                        \"documentType\": \"tenderNotice\",\n                        \"description\": \"Opportunity notice on Contracts Finder\",\n                        \"url\": \"https://www.contractsfinder.service.gov.uk/Notice/ed55e833-d154-48d4-9579-2011a820f6a0\",\n                        \"datePublished\": \"2022-10-21T16:37:44+01:00\",\n                        \"format\": \"text/html\",\n                        \"language\": \"en\"\n                    },\n                    {\n                        \"id\": \"2\",\n                        \"url\": \"https://www.adamprocure.co.uk\"\n                    }\n                ]\n            },\n            \"parties\": [\n                {\n                    \"id\": \"GB-CFS-209816\",\n                    \"name\": \"London Fire Brigade\",\n                    \"identifier\": {\n                        \"legalName\": \"London Fire Brigade\"\n                    },\n                    \"address\": {\n                        \"streetAddress\": \"London Fire Brigade, 169 Union Street\",\n                        \"locality\": \"London\",\n                        \"postalCode\": \"SE1 0LL\",\n                        \"countryName\": \"United Kingdom\"\n                    },\n                    \"contactPoint\": {\n                        \"name\": \"Anette Griffith\",\n                        \"email\": \"LCP@haringey.gov.uk\"\n                    },\n                    \"details\": {\n                        \"url\": \"https://londonconstructionprogramme.co.uk\"\n                    },\n                    \"roles\": [\n                        \"buyer\"\n                    ]\n                }\n            ],\n            \"buyer\": {\n                \"id\": \"GB-CFS-209816\",\n                \"name\": \"London Fire Brigade\"\n            }\n        },\n        {\n            \"ocid\": \"ocds-b5fd17-8e0e132b-e0c5-401b-ac8d-10790a78dfc1\",\n            \"id\": \"ddf600bd-8f46-4d09-a815-bf79e6913da5-583118\",\n            \"language\": \"en\",\n            \"date\": \"2022-10-21T16:36:48+01:00\",\n            \"tag\": [\n                \"tender\"\n            ],\n            \"initiationType\": \"tender\",\n            \"tender\": {\n                \"id\": \"ECC001-DN639234-55386836\",\n                \"title\": \"Family Innovation Fund (2023-2026) - Solution Focused Support\",\n                \"description\": \"The Family Innovation Fund enables ECC to work with its partners in the voluntary and community sector to deliver good outcomes as early as possible.  The services will not support those children, young people and families already known to and in receipt of support from specialist and statutory services, rather they will ensure delivery of support that complements, not duplicates existing services such as;\\r\\n\\r\\nâ¢\\tSchool funded support at additional levels of need\\r\\nâ¢\\tEssex Child and Family Wellbeing Service\\r\\nâ¢\\tEssex Integrated Wellbeing Service \\r\\nâ¢\\tChild and Adolescent Mental Health Service\\r\\nâ¢\\tFamily Solutions\\r\\n\\r\\nBy Early Intervention we mean stopping something occurring or getting worse and for the purposes of this funding will provide brief, light touch interventions that will enable children, young people, parents and carers to draw on their own resources and resilience to resolve future problems. \\r\\n\\r\\nThis Grant is concerned with working with children and young people, parents/carers and families who will benefit from receiving support by way of Brief Solution Focussed Support (BSFS) such as coaching, mediation, conflict resolution,  counselling,  through 1:1, group and family/parent/couples work.  This will usually take place in face to face however, it may also take place using on-line platforms if that is deemed appropriate, for example during holiday periods or weekends/evenings.\\r\\n\\r\\nThe total Family Innovation Fund is Â£1,200,000 over three years, with Â£720,000 allocated to BSFS  through 1:1, group and family/couples work.\\r\\n\\r\\n\\tYear 1 2023/24\\tÂ£300,000\\r\\n\\tYear 2 2024/25\\tÂ£210,000\\r\\n\\tYear 3 2025/26\\tÂ£210,000\\r\\n\\r\\nBSFS will be delivered across Essex but priority will be given to The Essex Levelling Up  areas set out in the table in 6.1 to support the delivery of our levelling ambitions and Everyone\'s Essex Plan Everyones Essex \\r\\n\\r\\nThere will be provision within the Grant Agreement, at the discretion of ECC to extend the grants for up to two years on a one plus one year basis.  There will be further provision for the value to be varied within any extension up to the original year one value namely Â£300,000.\\r\\n\\r\\nProvision in the Grant Agreement (clause 12) outlines the conditions under which ECC will either withhold or claim back funds paid to the provider.\\r\\n\\r\\n\",\n                \"datePublished\": \"2022-10-21T16:36:48+01:00\",\n                \"status\": \"active\",\n                \"classification\": {\n                    \"scheme\": \"CPV\",\n                    \"id\": \"98900000\",\n                    \"description\": \"Services provided by extra-territorial organisations and bodies\"\n                },\n                \"additionalClassifications\": [\n                    {\n                        \"scheme\": \"CPV\",\n                        \"id\": \"85300000\",\n                        \"description\": \"Social work and related services\"\n                    },\n                    {\n                        \"scheme\": \"CPV\",\n                        \"id\": \"98100000\",\n                        \"description\": \"Membership organisation services\"\n                    }\n                ],\n                \"items\": [\n                    {\n                        \"id\": \"1\",\n                        \"deliveryAddresses\": [\n                            {\n                