ntic service in Lincolnshire. The deadline for RfQ submissions is 12:00pm on Monday 7th November 2022.\\r\\n\\r\\nThe new contract will commence on 1st January 2023 for a period of 24 Months until 31st December 2024. The service must be provided under the supervision of a Specialist Orthodontist.\\r\\n\\r\\nThis opportunity may be of interest to an existing Specialist Orthodontic practice or to a general dental practice able to secure the services of a Specialist Orthodontist. In total there will be no more than 216 cases in Active Treatment or needing new case starts and no cases in Supervised Retention. In recognition of the fact that capacity is currently constrained in the Lincolnshire area, the Commissioner is looking for multiple providers to carry out this work. The caseload would be split as equitably as possible between the highest four scoring Bidders.\\r\\n\\r\\nThe estimated total contract value for all of the available cases combined will be Â£332,443.44 over the life of the contract and is based on price per patient (Â£1,539.09) in Active Treatment.\\r\\n\\r\\nAs this is as a result of an unforeseen circumstance, there are a higher than normal number of patients who require remedial work due to interrupted treatment. NHS England recognises that substantial further work is necessary to satisfactorily complete treatment; for example, where a new appliance fit is needed. Therefore, a higher payment rate has been agreed to assist Providers in delivering the level of care this cohort of patients requires. Please note, this rate is offered at this time in an exceptional circumstance, and future offers for orthodontic closedown agreements will revert to the National Tariff rate of Â£662.00 per patient.  \\r\\n\\r\\nIf you wish to express an interest please register on the EU Supply website https://uk.eu-supply.com/login.asp?B=UK. The project reference is Quote/tender 60346 - AG22022 - Short-Term Service to complete existing Orthodontic work in the Lincolnshir