": \"Midlands Partnership Foundation Trust\"\n            }\n        },\n        {\n            \"ocid\": \"ocds-b5fd17-051fe72d-cbb0-497a-9c83-368cb429f4dd\",\n            \"id\": \"232566bb-dae7-4209-823b-b0764b4aa7d2-583097\",\n            \"language\": \"en\",\n            \"date\": \"2022-10-21T16:05:10+01:00\",\n            \"tag\": [\n                \"tender\"\n            ],\n            \"initiationType\": \"tender\",\n            \"tender\": {\n                \"id\": \"20221021160503-72814\",\n                \"title\": \"T/KJ193/22 WP16/RACE Divertor Coil Removal\",\n                \"description\": \"United Kingdom Atomic Energy Authority (UKAEA) - the Client - is developing technologies for nuclear decommissioning in both fusion and fission fields. UKAEA is proving feasibility of different cutting tools for size reduction of different components. Those technologies will eventually be deployed fully remotely in the final application. Currently undertaken study focuses on cutting of a complex, nonradioactive component. The workpiece to be cut is made of multiple copper coils encased in resin, cladded with Inconel and with stainless steel heat shields attached.  The two technologies investigated are the diamond wire saw (DWS) cutting and circular saw (CS) cutting. Both have been previously deployed to cut the work piece, but further development of those technologies is needed. The focus of the proposed trials is to investigate cold and dry cutting and perform reaction force and temperature measurement.\\r\\nTherefore, UKAEA is looking at contracting a cutting technology specialist to demonstrate cutting of the work piece using both technologies in accordance with the specification.\\r\\n\\r\\nThe Client is particularly interested in learning about blade types, forces and temperatures observed during Circular Saw cutting. The justification for performing CS trials is based on expert recommendation of CS technology and to understand the feasibility of the technology based on prior CS trials. There are CS technology concerns that the Client is interested to understand, particularly Blade type, required sample clamping forces, required cutting forces, recommended cutting speed and rate. Likelihood of CS snagging / stopping abruptly and with high stopping loads (what is the\\r\\nmaximum torque), amount and type of swarf / material generated when compared to a DWS, sample temperatures reached during cutting and the effect on the Epoxy Resin within the Divertor Coils, heat generation of smoke, harmful and damaging halogen gases which could damage extract gas handling systems.\",\n                \"datePublished\": \"2022-10-21T16:05:10+01:00\",\n                \"status\": \"active\",\n                \"classification\": {\n                    \"scheme\": \"CPV\",\n                    \"id\": \"38400000\",\n                    \"description\": \"Instruments for checking physical characteristics\"\n                },\n                \"additionalClassifications\": [\n                    {\n                        \"scheme\": \"CPV\",\n                        \"id\": \"38800000\",\n                        \"description\": \"Industrial process control equipment and remote-control equipment\"\n                    },\n                    {\n                        \"scheme\": \"CPV\",\n                        \"id\": \"38900000\",\n                        \"description\": \"Miscellaneous evaluation or testing instruments\"\n                    },\n                    {\n                        \"scheme\": \"CPV\",\n                        \"id\": \"42000000\",\n                        \"description\": \"Industrial machinery\"\n                    },\n                    {\n                        \"scheme\": \"CPV\",\n                        \"id\": \"43000000\",\n                        \"description\": \"Machinery for mining, quarrying, construction equipment\"\n                    },\n                    {\n                