   \"endDate\": \"2025-09-04T23:59:59+01:00\"\n                    },\n                    \"documents\": [\n                        {\n                            \"id\": \"1\",\n                            \"documentType\": \"awardNotice\",\n                            \"description\": \"Awarded contract notice on Contracts Finder\",\n                            \"url\": \"https://www.contractsfinder.service.gov.uk/Notice/c53749d9-48ee-48b7-844b-bcb151a43e95\",\n                            \"datePublished\": \"2022-10-21T15:59:01+01:00\",\n                            \"format\": \"text/html\",\n                            \"language\": \"en\"\n                        }\n                    ]\n                }\n            ]\n        },\n        {\n            \"ocid\": \"ocds-b5fd17-028fa1ba-eb8e-4341-bf94-ec0bf6370ddf\",\n            \"id\": \"599964e9-ede8-472b-b945-fbb6754b15d6-583074\",\n            \"language\": \"en\",\n            \"date\": \"2022-10-21T15:56:52+01:00\",\n            \"tag\": [\n                \"tender\"\n            ],\n            \"initiationType\": \"tender\",\n            \"tender\": {\n                \"id\": \"227745\",\n                \"title\": \"World Beneath Waves Exhibition- Design & Manage ITT\",\n                \"description\": \"The National Museum of the Royal Navy (NMRN) wishes to appoint an exhibition designer for a colourful and engaging exhibition at Portsmouth, showcasing objects and interactives based on HMS Challenger\'s famous voyage of 1872-6, with linked content displayed at NMRN Hartlepool. The exhibition will also highlight the Royal Navy\'s continued involvement in science at sea, in the context of the Challenger legacy.\\r\\n\\r\\nThe exhibition tender will comprise of Phase 1 (Design) and Phase 2 (Manage), with a break between them, the NMRN are committing to work to RIBA Stage 4 value of Â£28k for Phase 1. \\r\\n\\r\\nIf the proposals for full costs (not exceeding Â£199,100) are taken forward to proceed to Phase 2 (manage - up to Riba Stage 6) we will continue with the winning bid and design for this tender.  \\r\\n\\r\\nThe exhibition tender will comprise of;\\r\\n\\r\\nâ¢\\tPhase 1 (Design- up to Riba Stage 4)\\r\\nFirm Price at submission.\\r\\n\\r\\nâ¢\\tPhase 2 (Manage up to Riba Stage 6)\\r\\nDetailed proposed costs at submission, then fully costed when the design is finalised.\\r\\n\\r\\nThe NMRN are committing to work to Phase 1. \\r\\nPhase 2 is subject to fundraising.\\r\\n\\r\\nLocations and Dates:\\r\\n\\r\\nSpecial exhibition area, Storehouse 10 galleries, National Museum of the Royal Navy, Portsmouth (NMRNP).\\r\\n\\r\\nModular display to fit existing gallery at NMRN Hartlepool (NMRNH) should be part of any full cost proposals with linked content to main exhibition in Portsmouth. This site is home to HMS Trincomalee, still afloat and open to visitors; the ship has its own story of circumnavigation - content here will be on the theme of Worlds Beneath the Waves but more tailored towards Trincomalee\'s story.\\r\\n\\r\\nFull details can be found in the ITT document and also the Appendix A Design Brief. \\r\\n\\r\\nSite Visits if required by suppliers must be booked in advance, these will be held 2nd & 3rd November 2022. \\r\\n\\r\\nWe can support virtual visits as well if required. Please email Eileen.clegg@nmrn.org.uk to organise this by referencing this tender in your email subject. \\r\\n\\r\\nPlease note, this is a rerun of a previously withdrawn tender reference 226904.\",\n                \"datePublished\": \"2022-10-21T15:56:52+01:00\",\n                \"status\": \"active\",\n                \"classification\": {\n                    \"scheme\": \"CPV\",\n                    \"id\": \"92521000\",\n                    \"description\": \"Museum services\"\n                },\n                \"items\": [\n                    {\n                        \"id\": \"1\",\n                        \"deliveryAddresses\": [\n                            {